import React, { useEffect, useState } from 'react';
import axios from 'axios';


const App = () => {
  

  const PetList = () => {

    const fetchPets = async () => {
      const response = await axios.get('/api/adoptapet');
      return response.data;
    }
  
    const Pet = ({name, photos, description}) => {
      return (
        <div className="pet">
          <h3>{name}</h3>
          <img src={photos[0].full} alt={name} />
          <p>{description}</p> 
        </div>
      );
    };

    const [pets, setPets] = useState([]);
  
    useEffect(() => {
      const fetchPets = async () => {
        const pets = await fetchPets();
        setPets(pets);
      };
      fetchPets();
    }, []);
  }

  return (
    <div>
      {pets.map(pet => (
        <Pet key={pet.id} {...pet} />
      ))}
    </div>
  );

};

export default App;
